import React from "react";
import {
  Form,
  FormControl,
  Navbar,
  Nav,
  NavItem,
  NavDropdown,
  MenuItem,
} from "react-bootstrap";
import Button from "react-bootstrap/Button";

const Navs = () => {
  return (
    <>
      <Navbar bg="green-500" variant="dark" expand="lg">
        <Navbar.Brand href="#home">Student Portal</Navbar.Brand>
        <Navbar.Toggle aria-controls="basic-navbar-nav" />
        <Navbar.Collapse id="basic-navbar-nav">
          <Nav className="mr-auto">
            <Nav.Link href="#home">Profile</Nav.Link>
            <Nav.Link href="#linsk">Courses</Nav.Link>
            <Nav.Link href="#lidnk">Results</Nav.Link>
            <Nav.Link href="#lifnk">Routine</Nav.Link>
          </Nav>
          <Button variant="secondary">LOGIN</Button>
        </Navbar.Collapse>
      </Navbar>
    </>
  );
};

export default Navs;
